import React from 'react'

// Sets data for the navbar
export const SidebarData = [
    // First navbar item
    {
        title: 'Program 1',
        path: '/program/:1',
        cName: 'dropdown-link'
    },
    // Second navbar item
    {
        title: 'Program 2',
        path: '/program/:2',
        cName: 'dropdown-link'
    },
    // Third navbar item
    {
        title: 'Program 3',
        path: '/program/:3',
        cName: 'dropdown-link'
    },
    // Fourth navbar item
    {
        title: 'Program 4',
        path: '/program/:4',
        cName: 'dropdown-link'
    },
    // Fifth navbar item
    {
        title: 'Program 5',
        path: '/program/:5',
        cName: 'dropdown-link'
    },
]
